import { Observable } from 'rxjs';
import {
  JSONRequestParameters,
  jsonRequest,
  blankRequest,
  BatchRequestParameters,
  BatchResponseParameters,
  batchRequest,
  concurrentBatchRequest,
} from './base';

export interface BasicAPI {
  jsonRequest(parameters: JSONRequestParameters): Observable<any>;

  blankRequest(parameters: JSONRequestParameters): Observable<null>;

  batchRequest(parameters: BatchRequestParameters): Observable<BatchResponseParameters[]>;
  concurrentBatchRequest(parameters: BatchRequestParameters): Observable<BatchResponseParameters[]>;
}

export class BasicClient implements BasicAPI {
  jsonRequest(parameters: JSONRequestParameters): Observable<any> {
    return jsonRequest(parameters);
  }

  blankRequest(parameters: JSONRequestParameters): Observable<null> {
    return blankRequest(parameters);
  }

  batchRequest(parameters: BatchRequestParameters): Observable<BatchResponseParameters[]> {
    return batchRequest(parameters);
  }

  // Requries BatchRequest body to be base64 encoded. Runs parallel, can only be used for
  // Thread PATCH
  concurrentBatchRequest(
    parameters: BatchRequestParameters,
  ): Observable<BatchResponseParameters[]> {
    return concurrentBatchRequest(parameters);
  }
}
